(7, '496557', 'I once read someone suggesting that writers should spend at least six hours writing an article around 1000 words. Who has time for that?\r\nIf you are getting paid to write that specific article, yeah, take six hours and do a spectacular job. But if you may or may not make money on it, for example, if you are a blogger, you don’t have the time to waste.\r\nMost articles and blogs that I write happen in less than an hour from the moment I start typing to the moment I publish or send it off. Here’s how I get it done.\r\n\r\nMental cataloging\r\nIf you sit down at the computer and have no idea what you are going to write about, you will not write anything worth reading in less than an hour. It is important to know what you will write before you begin writing.\r\nI call this process mental cataloging. To me, mental cataloging is the process by which you think, process the world and create ideas. It is the activity of passively brainstorming throughout your day. I write a lot about writing and leadership. So I am constantly analyzing my day through these two fields. When I am writing, I ask myself, “What is happening here?” “What can someone else learn from my experience?” These questions lead me to the articles I write about the writing process.\r\nRecently, I have been listening to and reading books about leadership, productivity, and company culture. I usually consume these books during my drive to and from work. As I drive, I think through these topics that I am hearing and look at my own work life through the new found lens. Usually I become passionate about something. Recently, my passion has been about good leadership. As I drive, I begin mentally cataloging my ideas about leadership and my experiences.\r\nLet’s look at something I wrote yesterday.\r\n\r\nI began mentally cataloging this article as I went about my morning routine. As you can imagine, I was feeling less than motivated by work. Before I even put pen to paper I had three of my four points outlined in my head.\r\nThis brings me to my first main point: most of the work of getting articles down quickly happens before you are even in the writing zone. If you want to get good at mentally cataloging for writing, you need to see the world with curiosity. What are some ways the world is broken? How can those broken places be fixed? These questions can naturally lead you to articles.\r\nOutline your main points\r\nAfter you have mentally cataloged, you can begin writing. I always start with a simple outline of my main points. For the above article about workplace motivation, I had three of my points in my head and I came up with the fourth early in the writing of the article. Having an outline gives you a roadmap for connecting your thoughts. It allows you to space out your words so you don’t spend too much time on one section and not enough on another.\r\nAgain, if the goal is quickly writing, then you don’t need to spend a ton of time on your outline. My general rule is the longer the piece, the longer the outline. For anything under 1000 words, a simple word or phrase for each point is the extent of my outline.\r\n\r\nStart in the middle\r\nAnd now it is time to write. It can be tempting to jump right into an introduction, but most of the time, time spent crafting an introduction before you have written anything else is time wasted. So many times when I start with an introduction, I realize halfway through the piece that my introduction doesn’t actually fit what I am writing. And so I have to rewrite it. This is time wasted. I will usually start with an introduction only if I have a specific story I want to tell or when I have the article mapped out in my head in a very detailed manner.\r\nRather than fumble around with an introduction, start right in on point one. Then write point two, three, etc. and your conclusion. Then write your introduction tying everything together from the beginning. Your readers will think you are brilliant.', 'Payments', 'Withdraws', '/storage/ban-2204738.jpg', 'Deleted', '2021-08-05 13:12:18', '2021-08-05 13:19:10'),
(8, '958460', 'To withdraw money from Appnomu website or Application is just simple and secure. Appnomu allows all Ugandans above the age of eighteen to create an account and start accessing the loans and savings. Most have been wondering how to make a withdraw on Appnomu.\r\nTo do so, kindly login in your account and then locate to my withdraw, select AW withdraw, enter the amount which is less or equivalent to the amount saved , them initiate or click make withdrwaw.\r\nYou will then receive such amount on your registered mobile number and you would have withdrawn your savings.\r\npleases note that, Appnomu does not charge any amount during withdraw but telecom companies will charge you while using withdrawing for spending, You are also unable to withdraw funds when they have not matured .', 'How to withdraw Money from Appnomu website', 'Need some loan trust Appnomu', '/storage/ban-2577884.jpg', 'Live', '2021-08-06 01:11:24', '2021-08-06 06:52:30'),
(9, '958460', 'To save with us is simple and secure, what you need is to have an account with us and after verifying your account, you can select either to save or to get a loan. To save, locate to my savings from your account, choose the savings category and enter the amount of money between the chosen category and click make payment.\r\nA check out page will load, enter the number which has the funds that you want to save, then you will receive the codes to validate the number, upon validating, we will send a push request on your phone and then you will need to put in your PIN.\r\nWait for the payment page to load until you see a success page, for payment and your savings will be topped up in your account', 'How to save your money?', 'Save your money to grow your dream', '/storage/ban-2137322.jpg', 'Live', '2021-08-07 21:28:42', '2021-08-07 21:29:24'),
(10, '958460', 'To repay or save using a card is simple and more safer, to do so, simply go to savings or repay your loan, upon choosing the the repay loan or savings, a checkout page for payment will load, however, instead of putting in mobile number, look down and you will see the option of changing the method, choose card and enter the card details, click pay, the Bank may send you OTP if it is your first time to make payment, copy the code and verify and upon successful verification, we shall deduct the due amount from your bank and will be topped up to your savings account.', 'How to save and repay your loan using CARDS?', 'Pay using cards.', '/storage/ban-3498651.jpg', 'Live', '2021-08-07 21:50:51', '2021-08-07 21:51:26'),
(11, '958460', 'Appnomu Microfinance is a fintech which is trusted by thousands of Ugandans. Currently we introduced the referral program benefiting Ugandans. To do so, you need to find a friend, relative, family member and tell them about Appnomu, once they register, request them to use your customer number as referral code, upon doing so, you will be given UGSHS1000 after your client registering, if she or he takes a loan and pays back, you will be given USHS2000 and when he or she saves 50K to 200K you will be given 5K and above 200K, you will be given 10K, this money will be seen under your available balance and you can withdraw when you are withdrawing your savings, and it will be available for spending.\r\nThis referral is continious  and will be there until you decide to close your account.', 'How to refer your friend or relative to Appnomu Microfinance', 'Earn through referring', '/storage/ban-7348235.jpg', 'Live', '2021-08-08 19:57:15', '2021-08-08 20:19:47'),
(12, '958460', 'Have your forgotten your password and you want to reset your password, the process of securing and resetting your password is simple , click forget password, enter your email address you used to create an account with us, we will send you the login the codes on your email which must put and then reset your password, after resetting, you will be redirected to login page, Now continue to login using the new set password. Please always keep your passwords safe nd secure and do not share your passwords.', 'How to rest your password on Appnomu?', 'reset your password', '/storage/ban-2389656.png', 'Live', '2021-08-10 00:07:36', '2021-08-10 00:08:19'),
(13, '958460', 'Need to grow your loan limit with Appnomu, wanna show you how you can grow your loan limit easily. Appnomu Microfinance gives loans to Ugandans above the age of eighteen having identification particulars and also enables clients to save. To grow your loan limit, you need to be an active customer , you need to repay your loan on time and as well as you save, you need to refer more clients who can take loans and who can save. \r\nHowever, saving is the most considered factor for growing loan limits.', 'How to grow your loan Limit with Appnomu Microfinance', 'Grow your loan limit', '/storage/ban-1584685.png', 'Live', '2021-08-10 01:31:25', '2021-08-10 01:31:57'),
(14, '958460', 'How to add an alliances in my account, to do so, means you have registered with us and you are able to login, after logging in, click on your account dashboard menu if you are using the smartphone or application, you will see the three dashes representing the menu on your left side corner, click and locate to add alliance.\r\nYou will be required to enter the alliance\'s full authentic names, national ID details, particularly the NIN, valid mobile number they use and must be active(while adding, include the +256...), relationship between you and the alliance and you will need to save.\r\nPlease make sure that you have consented with the alliances as we will send the alliance the message requesting him or her to be the alliance, once the code is provided by your alliance, you will need to confirm .\r\nNote: Do not close the page, leave the page open so that you can add the alliances confirmation codes and the alliances are not updated since these are the people who your guarantors incase of defaulting. \r\n\r\nWhere you need to be someone\'s alliances, please make sure that you trust such a person', 'How to add alliances on your appnomu account?', 'Add alliances to verify your account', '/storage/ban-7772933.png', 'Live', '2021-08-10 06:35:33', '2021-08-10 06:37:15'),
(15, '958460', 'As of 10th/08/21, Appnomu removed the transactions which was being added on your loans and savings automatically and is now Appnomu covering the expenses of transaction from merchant and taxation. However, before every account can receive a loan effective from 10th/08/2021. they must activate account top up of monthly payment UGSHS 4000 to cover the expensive costs which was being impossed on them. The activation fee supports three loan transactions and oine saving transaction therefore, if you do not make any loan transaction or savings, you won\'t be billed next month until your finish the transactions. How to activate, to activate, you need to make a payment of UGSHS4000 online using the online payment form which you will have to fill in with ypour customer number and you would have activated a loan.. \r\nTo activate, kindly follow the link https://bit.ly/3yGsQur and secure your loan account. Savings are not charged.', 'How to activate my Appnomu account', 'activation fee for Appnomu Loans', '/storage/ban-3000474.jpg', 'Live', '2021-08-11 01:21:14', '2021-08-11 01:22:24'),
(16, '958460', 'The best fundamental  way of growing your Appnomu loan limit is paying your loan on time so you maintain  a good loan repayment  history. \r\nTo repay your loan, you can use mobile money,cards or dashboard.( dashboard  means savings)\r\nLogin your account, and from the menu, select my loans, you will see sub options, select my loan installment  and this will list the ongoing loan you have with Appnomu,  choose select action and from here, you will be able to choose which payment  method. \r\nWhen you choose mobile money, you will be taken to checkout page and you will need to enter the mobile number which have enough funds. You will then receive OTP (ONE TIME PASSWORD) to validate the number. Once you successfully  validate the number,  you will see a screen  pop asking you to put your mobile money PIN towards your payment and you would have repaid your loan.\r\nAlternatively,  you can use domestic Bank cards, Centevisa cards, Master card and Credit cards. To choose this, choose mobile money payment,  instead do not put your number, look down the page  you will have the option of changing the payment method and from there, select card payment, enter details and you will be able to repay. \r\nTo use savings, choose pay with dashboard  and we shall deduct your savings to cover your loan. Kindly note, only matured savings can be used to repay your loan.\r\n\r\nNOTE: for your payment  to appear in your account, do not close the payment page even if you receive payment  message from mobile telecom.  Leave the payment  page to load, until it reads \" your payment was successful and you will now see that your loan status will read and marked as paid 😀.', 'How to repay my Appnomu  loan', 'Repay your loan to grow your loan limit', '/storage/ban-6904135.jpg', 'Live', '2021-08-12 20:02:15', '2021-08-12 20:02:51'),
(17, '958460', 'To most of us, we get a loan denied message from Appnomu and we wonder what could be the problem/challenge. Appnomu believes in providing good services to Ugandans AND we have so far given out loans to several clients especially Ugandans. When your loans is denied, please check whether you uploaded the national ID both sides, Added and confirmed the allaince, check whether you have have updated the profile by filling in your National ID details, NIN, Card Number and address. One reason why you loan might be not approved is because you have not activated your loan account fee of UGSHS which is paid on 0775383963 or you might have defaulted the previous loan you took.\r\nMake sure you pay on time to qualify for a bigger loan limit.', 'Why is my loan not approved', 'Loan Denied Message', '/storage/ban-9665700.jpg', 'Live', '2021-08-23 09:15:00', '2021-08-23 09:16:22'),
(18, '958460', 'Very many Ugandans have been requesting for this service and Appnomu added the new services of business loans. However one to obtain a business loan must have the following qualities;\r\n\r\n1. Have a valid account; You must have registered with Appnomu and validated an account and you must have been a client of Appnomu for 90 days and above, having a saving profile of UGSHS 100,000 and above with a good loan repayment history. \r\n\r\n2. Your business must be dully registered and licensed by the government of Uganda or its equivalent department, you must be  in position to provide business profile in pdf format, you business must have existed for at least six months and you should provide valid physical address.\r\n\r\nAll businesses to be given loans must be legal business and except financial institutions for money lenders than Appnomu do not support or give loans, the rest of the businesses as long they meet the compliance of Appnomu can access the business loan services. \r\n\r\nWe strictly set standard measures of business that request for  business loans so they can be successful and be in good positions to pay back on time.', 'What are the procedures of obtaining the Appnomu business loans', 'Appnomu Business Loans', '/storage/ban-7137203.jpg', 'Live', '2021-08-23 09:40:03', '2021-08-23 09:41:09'),
(19, '958460', 'Appnomu Is A fintech company providing instant loans to Ugandans above the age of 18Yrs and above. We carefully designed our procedures for loan repayment to ease the lives of Ugandans towards solving financial emergencies. However, to ease payment, we designed loan installments to help clients pay in installments.\r\n\r\nFrom the loan of UGSHS30,000 and above, you can pay in installments where by the system will divide the number of installments into the amount of money borrowed and then then will also divide the installment number by the loan period. To See this, you will need to go to my loan installments and you will be ble to see loan installments and when they must be paid back.\r\n\r\nPlease make sure to pay for your loan installments on time and you will be qualifying yourself to a higher loan limit.\r\nFinding difficulties, email feedback@appnomu.com', 'What is Appnomu Loan Installments?', 'Loan Installment', '/storage/ban-7165585.png', 'Live', '2021-08-24 15:46:25', '2021-08-24 15:48:18');
